// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ChatStorage {
    struct Message {
        string sender;
        string text;
        uint256 timestamp;
    }

    Message[] public messages;

    event MessageSent(string sender, string text, uint256 timestamp);

    function sendMessage(string calldata _sender, string calldata _text) external {
        messages.push(Message({
            sender: _sender,
            text: _text,
            timestamp: block.timestamp
        }));

        emit MessageSent(_sender, _text, block.timestamp);
    }

    function getMessages() external view returns (Message[] memory) {
        return messages;
    }
}
